import React, { Component } from 'react';
import { connect } from "react-redux";
import { signOut } from "./../../actions/authedUser";

import "./Navbar.css";

class Navbar extends Component {
  render() {
    return (
      <div>
        <span className="nav-item">Home</span>
        <span className="nav-item">Leaderboard</span>
        <span className="nav-item">Add Question</span>
        <span className="nav-item">Logged in as: { this.props.username }</span>
        <span className="nav-item"><button>Log Out</button></span>
      </div>
    )
  }
}

const mapStateToProps = (state) => {
    return {
        username: state.authedUser.username
    };
}

const mapDispatchToProps = (dispatch) => {
    return {
        onClick: (id) => {
            dispatch(signOut(id));
        }
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(Navbar);
